import React from "react";


import TableRow from "../TableRow";

export default  function Table(props){
    return(
<table className={!props.isCollapsed ?"flex-95" :"flex-80"}>
  <tr>
    <th>Country</th>
    <th>Browser</th>
    <th style={{color:"white", borderRight:"none"}}> Date</th>
  </tr>
        <TableRow/>
</table>
    );
}
